import { createUseStyles } from 'react-jss';
import { CARD_SHADOW, BUTTON_PRIMARY, INPUT_TEXT } from '../../Components/Styles/Button';

const Styles = createUseStyles({
  root: {
    padding: '40px 20px',
    marginBottom: '40px',
    '&.card-shadow': CARD_SHADOW,
    '& .title': {
      color: '#67C8DC',
    },
    '& .subtitle': {
      color: '#4a5568',
      fontWeight: '400',
    },
    '& .button-primary': BUTTON_PRIMARY,
    '& .input-text': INPUT_TEXT,
    '& .form-link': {
      '& a': {
        color: '#4a5568',
        '& span': {
          fontWeight: 500,
        },
      },
    },
  },
});

export default Styles;
